00176                 else if (diagnosticLine.DiagnosticCodeTextSpan is null)
00177                 {
00178                     if (startInclusiveIndex is null)
00179                     {
00180                         startInclusiveIndex = stringWalker.PositionIndex;
00181                     }
00182                     else if (endExclusiveIndex is null)
00183                     {
00184                         if (stringWalker.CurrentCharacter == ':')
00185                         {
00186                             endExclusiveIndex = stringWalker.PositionIndex;
00187                             
00188                             diagnosticLine.DiagnosticCodeTextSpan = new(
00189                                 startInclusiveIndex.Value,
00190                                 endExclusiveIndex.Value,
00191                                 stringWalker.SourceText);
00192                             
00193                             startInclusiveIndex = null;
00194                             endExclusiveIndex = null;
00195                         }
00196                     }
00197                 }
00198                 else if (diagnosticLine.MessageTextSpan is null)
00199                 {
00200                     if (startInclusiveIndex is null)
00201                     {
00202                         // Skip the ' '
00203                         _ = stringWalker.ReadCharacter();
00204                     
00205                         startInclusiveIndex = stringWalker.PositionIndex;
00206                     }
00207                     else if (endExclusiveIndex is null)
00208                     {
00209                         if (badState)
00210                         {
00211                             _ = stringWalker.ReadCharacter();
00212                             continue;
00213                         }
00214                         
00215                         if (stringWalker.CurrentCharacter == ']' &&
00216                             stringWalker.NextCharacter == '\n' || stringWalker.NextCharacter == '\r')
00217                         {
00218                             while (stringWalker.CurrentCharacter != '[')
00219                             {
00220                                 if (stringWalker.BacktrackCharacter() == ParserFacts.END_OF_FILE)
00221                                 {
00222                                     badState = true;
00223                                     break;
00224                                 }
00225                             }
00226 
00227                             if (!badState)
00228                             {
00229                                 _ = stringWalker.BacktrackCharacter();
00230                                 endExclusiveIndex = stringWalker.PositionIndex;
00231                                 
00232                                 diagnosticLine.MessageTextSpan = new(
00233                                     startInclusiveIndex.Value,
00234                                     endExclusiveIndex.Value,
00235                                     stringWalker.SourceText);
00236                         
00237                                 startInclusiveIndex = null;
00238                                 endExclusiveIndex = null;
00239                             }
00240                         }
00241                     }
00242                 }
00243                 else if (diagnosticLine.ProjectTextSpan is null)
00244                 {
00245                     if (startInclusiveIndex is null)
00246                     {
00247                         // Skip the ' '
00248                         _ = stringWalker.ReadCharacter();
00249                         // Skip the '['
00250                         _ = stringWalker.ReadCharacter();
00251                         
00252                         startInclusiveIndex = stringWalker.PositionIndex;
00253                     }
00254                     else if (endExclusiveIndex is null)
00255                     {
00256                         if (stringWalker.CurrentCharacter == ']')
00257                         {
00258                             endExclusiveIndex = stringWalker.PositionIndex;
00259                             
00260                             diagnosticLine.ProjectTextSpan = new(
00261                                 startInclusiveIndex.Value,
00262                                 endExclusiveIndex.Value,
00263                                 stringWalker.SourceText);
00264                             
00265                             startInclusiveIndex = null;
00266                             endExclusiveIndex = null;
00267                         }
00268                     }
00269                 }
00270             }
00271         
00272             _ = stringWalker.ReadCharacter();
00273         }
00274         
00275         lock (_listLock)
00276         {
00277             var allDiagnosticLineList = diagnosticLineList.OrderBy(x => x.DiagnosticLineKind).ToImmutableList();
00278         
00279             _dotNetRunParseResult = new()
00280             {
00281                 Message = message,
00282                 AllDiagnosticLineList = allDiagnosticLineList,
00283                 ErrorList = allDiagnosticLineList.Where(x => x.DiagnosticLineKind == DiagnosticLineKind.Error).ToImmutableList(),
00284                 WarningList = allDiagnosticLineList.Where(x => x.DiagnosticLineKind == DiagnosticLineKind.Warning).ToImmutableList(),
00285                 OtherList = allDiagnosticLineList.Where(x => x.DiagnosticLineKind == DiagnosticLineKind.Other).ToImmutableList(),
00286             };
00287         }
00288         
00289         StateChanged?.Invoke();
00290     }
