00501     public List<string> ParseOutputLineDotNetTestListTests(string outputEntire)
00502     {
00503         var textIndicatorForTheList = "The following Tests are available:";
00504         var indicatorIndex = outputEntire.IndexOf(textIndicatorForTheList);
00505     
00506         if (indicatorIndex != -1)
00507         {
00508             var theFollowingTestsAreAvailableList = new List<string>();
00509             var outputIndex = indicatorIndex;
00510             var hasFoundFirstLineAfterIndicator = false;
00511             
00512             while (outputIndex < outputEntire.Length)
00513             {
00514                 var character = outputEntire[outputIndex];
00515                 
00516                 if (!hasFoundFirstLineAfterIndicator)
00517                 {
00518                     if (character == '\r')
00519                     {
00520                         // Peek for "\r\n"
00521                         var peekIndex = outputIndex + 1;
00522                         if (peekIndex < outputEntire.Length)
00523                         {
00524                             if (outputEntire[peekIndex] == '\n')
00525                                 outputIndex++;
00526                         }
00527                         
00528                         hasFoundFirstLineAfterIndicator = true;
00529                     }
00530                     else if (character == '\n')
00531                     {
00532                         hasFoundFirstLineAfterIndicator = true;
00533                     }
00534                 }
00535                 else
00536                 {
00537                     // Read line by line each test's fully qualified name
00538                     if (character == '\t' || character == ' ')
00539                     {
00540                         if (character == '\t')
00541                         {
00542                             outputIndex++;
00543                         }
00544                         if (character == ' ')
00545                         {
00546                             // This code skips 4 space characters
00547                             while (outputIndex < outputEntire.Length)
00548                             {
00549                                 if (outputEntire[outputIndex] == ' ')
00550                                     outputIndex++;
00551                                 else
00552                                     break;
00553                             }
00554                         }
00555                     
00556                         var startInclusiveIndex = outputIndex;
00557                         var endExclusiveIndex = -1; // Exclusive because don't include the line ending
00558                         
00559                         while (outputIndex < outputEntire.Length)
00560                         {
00561                             if (outputEntire[outputIndex] == '\r')
00562                             {
00563                                 endExclusiveIndex = outputIndex;
00564                             
00565                                 // Peek for "\r\n"
00566                                 var peekIndex = outputIndex + 1;
00567                                 if (peekIndex < outputEntire.Length)
00568                                 {
00569                                     if (outputEntire[peekIndex] == '\n')
00570                                         outputIndex++;
00571                                 }
00572                             }
00573                             else if (outputEntire[outputIndex] == '\n')
00574                             {
00575                                 endExclusiveIndex = outputIndex;
00576                             }
00577                             
00578                             if (endExclusiveIndex != -1)
00579                                 break;
00580                             
00581                             outputIndex++;
00582                         }
00583                         
00584                         // If final test didn't end with a newline. (this is a presumed possibility, NOT backed up by fact)
00585                         if (endExclusiveIndex == -1 && outputIndex == outputEntire.Length)
00586                             endExclusiveIndex = outputEntire.Length;
00587                     
00588                         theFollowingTestsAreAvailableList.Add(
00589                             outputEntire.Substring(startInclusiveIndex, endExclusiveIndex - startInclusiveIndex));
00590                     }
00591                     else
00592                     {
00593                         // The line did not start with '\t' or etc... therefore skip to the next line
00594                         while (outputIndex < outputEntire.Length)
00595                         {
00596                             if (outputEntire[outputIndex] == '\r')
00597                             {
00598                                 // Peek for "\r\n"
00599                                 var peekIndex = outputIndex + 1;
00600                                 if (peekIndex < outputEntire.Length)
00601                                 {
00602                                     if (outputEntire[peekIndex] == '\n')
00603                                         outputIndex++;
00604                                 }
00605                                 
00606                                 break;
00607                             }
00608                             else if (outputEntire[outputIndex] == '\n')
00609                             {
00610                                 break;
00611                             }
00612                             
00613                             outputIndex++;
00614                         }
00615                     }
00616                 }
00617                 
00618                 outputIndex++;
00619             }
00620             
00621             return theFollowingTestsAreAvailableList;
00622         }
00623         else
00624         {
00625             return null;
00626         }
00627     }
